import React, { useEffect, useState } from 'react'
import Navbar2 from '../Navbar2';
import swal from 'sweetalert';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { Box, Button, Card, CardContent, Typography } from '@mui/material';

function Bookingpage() {
    const [car,setcar]=useState({})


    const { id } = useParams();
    const loggedInCustomerId = localStorage.getItem("customerId");
    const history = useNavigate();

    useEffect(() => {
        const fetchData = async () => {
          try {
            const response = await axios.get(`http://localhost:4000/getsinglecar/${id}`);
            setcar(response.data);
          } catch (error) {
            console.error("Error fetching data: ", error);
          }
        };
    
        fetchData();
      }, [id]);


      const book = async (e) => {
        e.preventDefault();
        const storedToken = localStorage.getItem("token");
    
        if (storedToken) {
          try {
            const response = await axios.post("http://localhost:4000/booking", {
              customerId: loggedInCustomerId,
              carId: id,
             
            });
            console.log(response.data);
    
            swal({
              title: "",
              icon: "success",
            });
    
            history("/");
          } catch (error) {
            console.error("Error while booking:", error);
            swal({
              title: "",
              text: "Error while booking.",
              icon: "error",
            });
          }
        } else {
          swal({
            title: "",
            text: "Invalid details.",
            icon: "error",
          });
        }
      };

  return (
    <div>
      <Navbar2/>

      <div>
      <div style={{ width: "900px", marginTop: "200px", marginLeft: "350px" }}>
        <Box
          sx={{
            width: "100%",
            position: "relative",
            overflow: { xs: "auto", sm: "initial" },
          }}
        >
          
          <Card
            orientation="horizontal"
            sx={{
              width: "75%",
              flexWrap: "wrap",
              [`& > *`]: {
                "--stack-point": "500px",
                minWidth:
                  "clamp(0px, (calc(var(--stack-point) - 2 * var(--Card-padding) - 2 * var(--variant-borderWidth, 0px)) + 1px - 100%) * 999, 100%)",
              },
             
            }}
          >
     
            <CardContent>
              <div style={{ display: "flex" }}>
                <div>
                  <Typography fontSize="xl" fontWeight="lg">
                    {employee && (
                      <h3>{employee.name && employee.name.toUpperCase()}</h3>
                    )}
                  </Typography>
                  <Typography
                    level="body-sm"
                    fontWeight="lg"
                    textColor="text.tertiary"
                  >
                    {employee.jobCategory}
                  </Typography>
                </div>
                <div style={{ marginLeft: "350px", marginTop: "40px" }}>
                  <Typography
                    level="body-sm"
                    fontWeight="lg"
                    textColor="text.tertiary"
                  >
                    Email : {employee.email}
                  </Typography>
                  <Typography
                    level="body-sm"
                    fontWeight="lg"
                    textColor="text.tertiary"
                  >
                    &nbsp;&nbsp; Ph&nbsp;&nbsp; : {employee.phoneNumber}
                  </Typography>
                </div>
              </div>
              <Sheet
                sx={{
                  bgcolor: "background.level1",
                  borderRadius: "sm",
                  p: 1.5,
                  my: 1.5,
                  display: "flex",
                  gap: 2,
                  "& > div": { flex: 1 },
                }}
              >
                <div>
                  <Typography level="body-xs" fontWeight="lg">
                    Age
                  </Typography>
                  <Typography fontWeight="lg">{employee.age}</Typography>
                </div>
                <div>
                  <Typography level="body-xs" fontWeight="lg">
                    Experience
                  </Typography>
                  <Typography fontWeight="lg">
                    {employee.experience} years
                  </Typography>
                </div>
                <div>
                  <Typography level="body-xs" fontWeight="lg">
                    Rating
                  </Typography>
                  <Typography fontWeight="lg">&nbsp; &nbsp;-</Typography>
                </div>
              </Sheet>
        
              <div>
                <TextField
                  margin="normal"
                  color=""
                  required
                  fullWidth
                  name="date"
                  label=""
                  type="date"
                  id="date"
                  autoComplete=""
                  onChange={(e) => {
                    setBookingDate(e.target.value);
                  }}
                />
              </div>
              <Box sx={{ textAlign: "center", marginTop: "20px" }}>
                <Button
                  onClick={book}
                  variant="solid"
                  color="danger"
                  sx={{ width: "200px" }}
                >
                  Book
                </Button>
              </Box>
            </CardContent>
          </Card>
        </Box>

      </div>
    </div>
    </div>
  )
}

export default Bookingpage
